// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import Routes and Route
import ProductListPage from './ProductListPage'; // Correct the import path
import ProductPage from './ProductPage'; // Correct the import path

const App = () => {
  return (
    <Router>
      <Routes> {/* Use Routes instead of Switch */}
        <Route exact path="/" element={<ProductListPage />} /> {/* Use element prop to render components */}
        <Route path="/product/:id" element={<ProductPage />} /> {/* Use element prop to render components */}
      </Routes>
    </Router>
  );
};

export default App;
